import React, { useState, useEffect } from 'react';
import '../data.css';

var check = true

function Data() {

    const [isData, setData] = useState([])
    const [isConfiguredData, setConfiguredData] = useState({
        headerNBA: [],
    })

    useEffect(() => {
        fetch('/api').then(
            res => res.json()
        ).then(data => configureData(data))
    }, [])

    function configureData(data) {
        setData(data)
    }

    function setHeader(header) {
        var tempHeader = []
        let index = 0
        var sHeader = String(header)
        let temp = ""
        console.log("SET HEADER", sHeader)
        console.log("SET HEADER", sHeader[140])
        check = true

        while (check) {
            console.log("run")
            if (sHeader[index] == '`') {
                check = false
                console.log("BREAK")
            }
            if (index > 500) {
                check = false
            }
            else {
                temp += sHeader[index]
                index++
            }
        }
        index++
        let temp2 = temp.replace(/undefined/g, "")
        tempHeader += temp2
        console.log(isConfiguredData.headerNBA)
    }

    return (
        <div className="App">
            HI
            {setHeader(isData.headerNBA)}
        </div>
    );
}

export default Data;
